function App() {
  const [nGrids, setNGrids] = useState(0);

  function handleAddGrid() {
    console.log("Add a grid!");
  }

  return (
    <div className="App">
      {/* <div className="hidenMenuDiv">
        <HidenMenu />
      </div> */}

      <button className="addGridButton" onClick={handleAddGrid}>
        Add
      </button>
      <div className="gridSection">
        <YearGrid />
      </div>
    </div>
  );
}

export default App;
